import React from 'react';
import '../Card/style.css';

function Card() {






    return (
        <div className="container">
            <div className="card example z-depth-5" style="width: 18rem;">
                <img src="Success-Function.png" className="card-img-top bounce"  style="left: -30rem;right:30rem;" alt="..."/>
                <div className="card-body">
                    <h5 className="card-title">Card title</h5>
                    <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                </div>
                <ul className="list-group list-group-flush">
                    <li className="list-group-item"></li>
                    <li className="list-group-item"><a href="www.google.com" className="card-link fab fa-github-alt"></a>
                    <a href="www.google.com" className="card-link fab fa-chrome"></a></li>
                </ul>
            </div>
   
        </div>
      

    )
}


export default Card;
